parameters.text:
=Analyze this event registration and return JSON with persona classification, scoring, and recommendations.

ATTENDEE PROFILE:
Name: {{ $json.attendee_name }}
Company: {{ $json.company }}
Title: {{ $json.job_title }}
Industry: {{ $json.industry }}
Interests: {{ $json.interests }}
Event Goals: {{ $json.event_goals }}
Networking Goals: {{ $json.networking_goals }}
Expertise: {{ $json.expertise }}
Looking For: {{ $json.looking_for }}
Session Preferences: {{ $json.session_preferences }}

Return ONLY valid JSON (no markdown) with this structure:
{
  "persona": "founder|investor|executive|tech_professional|vendor|consultant|job_seeker|student",
  "engagement_score": 85,
  "influence_score": 75,
  "connection_value_score": 80,
  "openness_score": 90,
  "primary_objectives": ["objective1", "objective2", "objective3"],
  "ideal_connection_profile": "description",
  "recommended_sessions": [
    {"session_name": "Session 1", "relevance_score": 95, "reason": "why relevant"}
  ],
  "conversation_starters": ["starter1", "starter2", "starter3", "starter4", "starter5"],
  "engagement_tips": ["tip1", "tip2"],
  "considerations": ["concern1"]
}

parameters.jsCode:
const items = $input.all();
const results = [];

for (const item of items) {
  try {
    // Get AI response from output field
    const response = item.json.output || item.json.text || '';

    // Remove markdown code blocks if present
    let cleanJson = response.replace(/```json\n?|```\n?/g, '').trim();

    // Find JSON object
    const jsonMatch = cleanJson.match(/\{[\s\S]*\}/);
    if (jsonMatch) {
      cleanJson = jsonMatch[0];
    }

    const analysis = JSON.parse(cleanJson);

    // Get registration data
    const regData = $('Extract Registration Data').first().json;

    results.push({
      json: {
        ...regData,
        ...analysis
      }
    });
  } catch (error) {
    // Fallback if parsing fails
    const regData = $('Extract Registration Data').first().json;
    results.push({
      json: {
        ...regData,
        persona: 'tech_professional',
        engagement_score: 50,
        influence_score: 50,
        connection_value_score: 50,
        openness_score: 50,
        primary_objectives: ['Networking', 'Learning'],
        parsing_error: error.message
      }
    });
  }
}

return results;
